import React from "react";

const MusicList = (props) => {

    return (
        <div className="mt-10">
            <div>
                <img src={props.post.img} alt="Картина песни" />
            </div>
            <div>
                {props.post.title}
                {props.post.authorName}
            </div>
            <div>
                {props.post.liked}
            </div>
        </div>
    )
}

export default MusicList;
